import React from 'react';

import LoginPage from "./components/LoginPage";
import Page2 from "./components/Page2";
import Page3 from "./components/Page3";
import { GoogleOAuthProvider } from "@react-oauth/google";
import Profile from './components/Profile';
import Alexdetail from './components/Alexdetail';
import Emilydetail from './components/Emilydetail';


import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';



function App() {
  return (
    <div className='app'>
    <GoogleOAuthProvider clientId="706887665079-mgckk8kcmj7gjv13sfd8orgi6d3j8vcr.apps.googleusercontent.com"></GoogleOAuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Profile></Profile>} />
          <Route path="/Alexdetail" element={<Alexdetail></Alexdetail>} />
          <Route path="/Emilydetail" element={<Emilydetail></Emilydetail>} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/page2" element={<Page2 />} />
          <Route path="/" element={<LoginPage />} /> {/* Root Route */}
          <Route path="/page3" element={<Page3 />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
